mkdir "..\T3-Standalone\Player\bin\Release\net6.0-windows\publish"
copy "Player\bin\Release\net6.0-windows\publish\Player.exe"                    "..\T3-Standalone\Player\bin\Release\net6.0-windows\publish\Player.exe"
